import React from "react";
import ReactDom from "react-dom";
import Card from "./Card";
import Mdata from "Mdata";
import "./index.css";

ReactDom.render(
  <>
    <Card 
      imgsrc={Mdata[0].imgsrc}
      title={Mdata[0].title}
      fname={Mdata[0].fname}
      flink={Mdata[0].flink}
    />
    <Card
      imgsrc="https://english.cdn.zeenews.com/sites/default/files/styles/zm_700x400/public/2020/07/07/870897-dil-bechara.jpg"
      title="Hotstar Specials & Latest Movies"
      fname="Dil Bechara"
      flink="https://www.hotstar.com/in/tv/dil-bechara/s-2821"
    />
    <Card
      imgsrc="https://img1.hotstarext.com/image/upload/f_auto,t_vl/sources/r1/cms/prod/7676/647676-v"
      title="Hotstar Specials & Latest Movies"
      fname="Tanhaji"
      flink="https://www.hotstar.com/in/movies/tanhaji/1260022117"
    />
  </>, 
 document.getElementById("root")

);
